class TimesheetDepMd {  final int id;  final String staffName;  final String scheduledHours;  final String actualHours;  final String overtime;  final String timeOff;  final String lates;  final String cleans;  TimesheetDepMd(      {required this.id,      required this.staffName,      required this.scheduledHours,      required this.actualHours,      required this.overtime,      required this.timeOff,      required this.lates,      required this.cleans});  //init  factory TimesheetDepMd.init({String? name}) {    return TimesheetDepMd(      id: 1,      staffName: name ?? "",      scheduledHours: "",      actualHours: "",      overtime: "",      timeOff: "",      lates: "",      cleans: "",    );  }  factory TimesheetDepMd.fromJson(Map<String, dynamic> json) {    return TimesheetDepMd(      id: json['id'],      staffName: json['staffName'],      scheduledHours: json['scheduledHours'],      actualHours: json['actualHours'],      overtime: json['overtime'],      timeOff: json['timeOff'],      lates: json['lates'],      cleans: json['cleans'],    );  }  Map<String, dynamic> toJson() => {        'id': id,        'staffName': staffName,        'scheduledHours': scheduledHours,        'actualHours': actualHours,        'overtime': overtime,        'timeOff': timeOff,        'lates': lates,        'cleans': cleans,      };}